/* 
We keep two separate arrays to store last 14 price increments or losses.
*/

variable.last14U = []
variable.last14D = []

/* Loop Code */

// first step is to find the pivots of the source data
let lookLen = 14    //define max values to keep for lookback array
let checkLen = 3    // define length of pivot point to check
let oscHigh = 100   // highest value for RSI
let oscLow = 0      // lowest Value for RSI
let percWeak = 10    // threshold for weak detection
let percStr = 30     // threshold for strong detection

let strPerc = 0     // default value for divergence strength
let inpVal = 0
let prevTemp = 0.0001   //set a small number to prevent NaN/inf result for % strength calc
let prevTempLow = prevTemp
let prevTempHigh = prevTemp

let data = record.current   // assign all current data from the record here
//console.log("data assigned")

inpOsc = getElement('rsi14s', data) // extract RSI data  <- can be changed to accept whatever oscillator needed
//console.log("rsi14s extracted")
inpval = inpOsc.value    // extract just the value needed. Change 'value' to suit oscillator data
//console.log("value of rsi14 done: ", inpVal)

variable.candleMaxVals.push(record.current.max)
variable.candleMinVals.push(record.current.min)
variable.candleLocs.push(record.current.end)       // begin draws too early on charts

variable.pivVals.push(inpval)       // oscillator stored values

if (variable.candleMaxVals.length > lookLen) {
    variable.candleMaxVals.splice(0, 1) // keep the arrays to a manageable size
    variable.candleMinVals.splice(0, 1)
    variable.candleLocs.splice(0, 1)
    variable.pivVals.splice(0, 1)

    let arrSize = variable.candleMaxVals.length
    for (let i = checkLen; i < arrSize - checkLen; i++) {
        let currVal = variable.pivVals[i]    // input to pivot point finder

        if (checkHighOrLow(currVal, arrSize, checkLen, i, true)) {
            variable.oscHiTestPrev = variable.oscHighVal
            variable.candleHiTestPrev = variable.candleHighVal
            variable.oscHiPrevTestLoc = variable.oscHighLoc

            variable.oscHighVal = currVal
            variable.candleHighVal = variable.candleMaxVals[i]
            variable.oscHighLoc = variable.candleLocs[i]
            //console.log("high pivot ", variable.candleHighVal)
        }
        if (checkHighOrLow(currVal, arrSize, checkLen, i, false)) {
            variable.oscLoTestPrev = variable.oscLowVal
            variable.candleLoTestPrev = variable.candleLowVal
            variable.oscLoPrevTestLoc = variable.oscLowLoc

            variable.oscLowVal = currVal
            variable.candleLowVal = variable.candleMinVals[i]
            variable.oscLowLoc = variable.candleLocs[i]
            //console.log("low pivot ", variable.candleLowVal)
        }
    }

    // array not long enough yet, fill with default of 1 for now (peg to oscillator/candle/location for now)
} else {
    variable.oscHighVal = 1
    variable.oscLowVal = 2
    variable.candleHighVal = 3
    variable.candleLowVal = 4
    variable.oscHighLoc = 5
    variable.oscLowLoc = 6
    variable.oscHiTestPrev = 7
    variable.oscLoTestPrev = 8
}

if (variable.oscHighVal !== variable.oscHiTestPrev) {
    variable.oscHighValPrev = variable.oscHiTestPrev
    variable.candleHighValPrev = variable.candleHiTestPrev
    variable.oscHiPrevLoc = variable.oscHiPrevTestLoc
    variable.candHiPrevLoc = variable.oscHiPrevLoc       // osc and candle loc is always the same
}

if (variable.oscLowVal !== variable.oscLoTestPrev) {
    variable.oscLowValPrev = variable.oscLoTestPrev
    variable.candleLowValPrev = variable.candleLoTestPrev
    variable.oscLoPrevLoc = variable.oscLoPrevTestLoc
    variable.candLoPrevLoc = variable.oscLoPrevLoc      // osc and candle loc is always the same
}
if (variable.oscLowValPrev == 0 ) {
    prevTempLow = prevTemp
} else { prevTempLow = variable.oscLowValPrev }

if (variable.oscHighValPrev == 0 ){
    prevTempHigh = prevTemp
} else { prevTempHigh = variable.oscHighValPrev }

// calculate any divergence status & strength
if (variable.oscLowValPrev < variable.oscLowVal && variable.candleLowValPrev > variable.candleLowVal && (variable.oscLowValPrev < variable.oscLower || variable.oscLowVal < variable.oscLower)) {
    variable.div_stat = "bullish"   //expand to strong, medium, weak, etc

    strPerc = (variable.oscLowVal - variable.oscLowValPrev) / prevTempLow * 100
    if (Math.abs(strPerc) < percWeak) {
        variable.div_str = "weak"
    } else if (Math.abs(strPerc) >= percWeak && Math.abs(strPerc) < percStr) {
        variable.div_str = "medium"
    } else if (Math.abs(strPerc) >= percStr) {
        variable.div_str = "strong"
    } else { variable.div_str = "invalid" }

    variable.divPerc = strPerc

    //console.log("bullish found")
} else if (variable.oscHighValPrev > variable.oscHighVal && variable.candleHighValPrev < variable.candleHighVal && (variable.oscHighValPrev > variable.oscUpper || variable.oscHighVal > variable.oscUpper)) {
    variable.div_stat = "bearish"   //expand to strong, medium, weak, etc

    strPerc = (variable.oscHighVal - variable.oscHighValPrev) / prevTempHigh * 100
    if (Math.abs(strPerc) < percWeak) {
        variable.div_str = "weak"
    } else if (Math.abs(strPerc) >= percWeak && Math.abs(strPerc) < percStr) {
        variable.div_str = "medium"
    } else if (Math.abs(strPerc) >= percStr) {
        variable.div_str = "strong"
    } else { variable.div_str = "invalid" }

    variable.divPerc = strPerc

    //console.log("bearish found")
} else if (variable.oscLowValPrev > variable.oscLowVal && variable.candleLowValPrev < variable.candleLowVal && (variable.oscLowValPrev < variable.oscLower && variable.oscLowVal < variable.oscLower)) {
    variable.div_stat = "bull continuation"

    strPerc = (variable.oscLowVal - variable.oscLowValPrev) / prevTempLow * 100
    if (Math.abs(strPerc) < percWeak) {
        variable.div_str = "weak"
    } else if (Math.abs(strPerc) >= percWeak && Math.abs(strPerc) < percStr) {
        variable.div_str = "medium"
    } else if (Math.abs(strPerc) >= percStr) {
        variable.div_str = "strong"
    } else { variable.div_str = "invalid" }

    variable.divPerc = strPerc

    //console.log("hidden bull")
} else if (variable.oscHighValPrev < variable.oscHighVal && variable.candleHighValPrev > variable.candleHighVal && (variable.oscHighValPrev > variable.oscUpper && variable.oscHighVal > variable.oscUpper)) {
    variable.div_stat = "bear continuation"   //expand to strong, medium, weak, etc

    strPerc = (variable.oscHighVal - variable.oscHighValPrev) / prevTempHigh * 100
    if (Math.abs(strPerc) < percWeak) {
        variable.div_str = "weak"
    } else if (Math.abs(strPerc) >= percWeak && Math.abs(strPerc) < percStr) {
        variable.div_str = "medium"
    } else if (Math.abs(strPerc) >= percStr) {
        variable.div_str = "strong"
    } else { variable.div_str = "invalid" }

    variable.divPerc = strPerc

    //console.log("hidden bear")
} else {
    variable.div_stat = "none"
    variable.div_str = "none"
    variable.divPerc = 0
}

